                <Link to = "/Contact" className="nav-link atag">Contact</Link>

            </li>

            <li className="nav-item ">
                <Link to = "/Portfolio" className="nav-link atag">Portfolio</Link>

            </li>
          </ul>
        </div>
    </nav>
  );
}

export default NavBar;
